import { useState, useEffect } from 'react';
import './App.css';
import Element from './element/Element';

function App() {

  const [data, setData] = useState([]);
  useEffect(() => 
    fetch('http://cabe0232.odns.fr/sportscars-api/exam/api/broadway_shows')
      .then(response => response.json())
      .then(json => {setData(json);
        console.log(json);})
    ,[]);

  let ElementList = data.map(element => <Element season={element.Season} 
    revenue={element.Revenue} price={element.TicketPrice}
    key={element.Season}
  />);

  const Moy = (list) => {
    let rep = 0;
    let count = 0;
    let i = 0;
    list.forEach(number => {
      rep += number;
      i++;
    });
    return (rep/i);
  }

  console.log(Moy([5]))

  return (
    <section className="app-container">
      <h1>Broadway Shows</h1>
      <section className="app-content">   
        <div className="ListList">{ElementList} </div>
      </section>
      <div className="overlay"></div>
    </section>
  );
}

export default App;
